import React from "react";
import { AccountCircleIcon, MicrosoftLogo, NotificationsFilledIcon } from "../../assets/icons"
import { Header, IconButton } from "intelli-ui-components-library";
import styles from "./topNavbar.module.scss"



const TopNavbar = () => {
    return (
            <Header
                brandLogo={"https://www.drupal.org/files/intelliswift.png"}
                elevation={1}
            >
                <div className={styles["topbar"]}>
                    <div>
                        <NotificationsFilledIcon />
                    </div>
                    <div>
                        <AccountCircleIcon />
                    </div>
                </div>
            </Header>
    )
}

export default TopNavbar;
